      no: false,
      audio: false,
      load: false,
      morning: "morning",
      day: "day",
      evening: "evening",
      night: "night",
      constDay: "",
      constDayB: {},
      constDeadMan: "",
      constMP: Boolean,
      questionStap1: true,
      questionStap2: false,
      questionStap3: false,
      questionStap4: false,
      questionStap5: false,
      questionStap6: false,
      dayInput: "",
      monthInput: "",
      eareInput: "",
      emt: false,
      ansversaudio: "",
    };
  },
  methods: {
    ansvers(day) {
      this.load = true;
      setTimeout(() => {
        this.constDay = day;
        this.questionStap1 = false;
        this.questionStap2 = true;
        this.load = false;
      }, 600);
    },
    ansversBday() {
      this.load = true;
      setTimeout(() => {
        if (this.dayInput && this.monthInput && this.eareInput) {
          this.constDayB = {
            d: this.dayInput,
            m: this.monthInput,
            e: this.eareInput,
          };
          this.questionStap1 = false;
          this.questionStap2 = false;
          this.questionStap3 = true;
        } else {
          this.emt = true;
        }
        this.load = false;
      }, 600);
    },
    ansversDeadSlip(answer) {
      this.load = true;
      setTimeout(() => {
        this.constDeadMan = answer;
        this.questionStap1 = false;
        this.questionStap2 = false;
        this.questionStap3 = false;
        this.questionStap4 = false;
        this.questionStap5 = true;
        this.load = false;
      }, 600);
    },
    ansversAudio(ansver) {
      this.load = true;
      setTimeout(() => {
        this.ansversaudio = ansver;
        this.questionStap1 = false;
        this.questionStap2 = false;
        this.questionStap3 = false;
        this.questionStap4 = false;
        this.questionStap5 = false;
        this.audio = true;
        this.load = false;
      }, 600);
      setTimeout(() => {
        this.audio = false;
        this.lastPage = true;
      }, 3000);
    },
    ansversAll() {
      const ansversOBJACT = {
        days: this.constDay,
        bDay: { d: this.dayInput, m: this.monthInput, e: this.eareInput },
      };
      console.log(ansversOBJACT);
    },
  },
};
</script>

